import React from 'react';
import './About.css'
import Header from '../src/Component/Header';
import Slider from '../src/Component/Slider';
import Report from '../src/Component/Reportfrom';

function About() {
    return (
        <div>
            <Header />
            <Slider />
            <Report />

            <h1>Hey this is About Page</h1>

        </div>
    )
}

export default About;
